import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField  from '@mui/material/TextField';
import Button from '@mui/material/Button/Button';
import TableContainer from '@mui/material/TableContainer/TableContainer';
import TableHead from '@mui/material/TableHead/TableHead';
import TableCell from '@mui/material/TableCell/TableCell';
import TableRow from '@mui/material/TableRow/TableRow';
import TableBody from '@mui/material/TableBody/TableBody';
import Table from '@mui/material/Table/Table';
import Paper from '@mui/material/Paper/Paper';
import Container from '@mui/material/Container/Container';

export default function Home() {
  // const [values, setValues] = useState<Number[]>([1,2,3]) 
  const [size, setSize] = useState<String>("")

  useEffect(()=>{
    fetch(
      'http://127.0.0.1:5000/adrian',
      {
      // method :'GET',
      mode: "no-cors",
      // headers : {
      //   'Content-Type':'application/json',
      //   },
      }
    )
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(error => console.log(error))
    console.log("Modification")
  },[size])

  return (
    <Container maxWidth="sm">
      <Box>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField 
              id="outlined-basic" 
              label="Data size"
              variant="outlined"
              value={size} 
              onChange={(v)=>{setSize(v.target.value)}}/>
          </Grid>
          <Grid item xs={4}>
            <Button variant="contained">Load</Button>
          </Grid>
          <Grid item xs={6}>
              <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>API Names</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {[1,2,3].map((row) => (
                      <TableRow
                        key={"fdsqf"+ row}
                        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                      >
                        <TableCell component="th" scope="row"> {"fdsf"+row} </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
        </TableContainer>
          </Grid>
          <Grid item xs={6}>
            <div>API definition</div>          
            <Paper variant="outlined">This is a definition</Paper>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
